import React from 'react'
import { Navbar } from 'react-bootstrap'
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';

const Rechercheeheader = () => {
  return (
  

    <React.Fragment >
      <Container fixed style={{backgroundColor:"red",display:'flex',justifyContent:'center',marginBottom:'52vh',height:'100px',marginRight:'20px',width:'150vh'}} >
        <box ><h1>Rechercheeheader</h1></box>
      </Container>
    </React.Fragment>






  )
}

export default Rechercheeheader
